webpackJsonp([0xf4b5d9267ed5],{8845:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Blog Cred since August 1999",date:"27 May 2003",slug:"/2003-05-27-blog-cred-since-august-1999/",tags:"Y2003"},html:'<p>A number of folks (well, ok, two) at BlogTalk referred to me as a German blogging pioneer. It made me feel old, but it did earn me a number (two) of beers. My blog cred may not go back as far as that of Rebecca Blood (April 1999), who gave a keynote in Vienna, but I did try out Blogger for a few weeks later that summer. And, surprise, surprise, the <a title="Maus Newsletter" href="http://www.papascott.de/blogger99.html">Maus Newsletter</a> is still in the Blogger database. Just for fun, I decided to publish it (slightly edited for spousal privacy). </p>\n<p>This is not actually the <a title="PapaScott: Old Times" href="http://www.papascott.de/2001/09/10/1538.php">first time</a> I\'ve rediscovered my old Blogger page, though. I guess I have the right to dig it up evey 2 years.</p>'},next:{fields:{title:"Wenn die Mutter mit dem Sohn",date:"26 May 2003",slug:"/2003-05-26-wenn-die-mutter-mit-dem-sohn/"}},previous:{fields:{title:"City of Munich migrates from NT to Linux",date:"27 May 2003",slug:"/2003-05-27-city-of-munich-migrates-from-nt-to-linux/"}}},{node:{fields:{title:"Wenn die Mutter mit dem Sohn",date:"26 May 2003",slug:"/2003-05-26-wenn-die-mutter-mit-dem-sohn/",tags:"Y2003"},html:'<p><a title="Double Voyeur" href="http://lyssaslounge.diaryland.com/030526_35.html">Lyssas Lounge: Wenn die Mutter mit dem Sohn</a></p>'},next:{fields:{title:"MoPho",date:"25 May 2003",slug:"/2003-05-25-mopho/"}},previous:{fields:{title:"Blog Cred since August 1999",date:"27 May 2003",slug:"/2003-05-27-blog-cred-since-august-1999/"}}},{node:{fields:{title:"MoPho",date:"25 May 2003",slug:"/2003-05-25-mopho/",tags:"Y2003"},html:'<p><img src="http://www.papascott.de/fotos/200305251959dbdf27ea.jpeg" /></p>\n<p>I\'m not sure if posting photos from a cell phone can be considered quick or easy, or even sensible, but it is at least possible.</p>'},next:{fields:{title:"Don't blog me, I'm real!",date:"25 May 2003",slug:"/2003-05-25-dont-blog-me-im-real/"}},previous:{fields:{title:"Wenn die Mutter mit dem Sohn",date:"26 May 2003",slug:"/2003-05-26-wenn-die-mutter-mit-dem-sohn/"}}}],pathPrefix:"",first:!1,last:!1,index:724,pageCount:1101}}}});
